met Bin Won, Se-Ron Kim en Hyo-Seo Kim

Tae-sik Cha, gewoonlijk &quot;Ajusshi&quot; (mister) genoemd in zijn buurt, runt een vervallen lommerd in een achterbuurt. Niemand weet 
veel van hem af en hijzelf bemoeit zich met geen mens, behalve So-mi, het dochtertje van junkiemoeder Hyo-jeong. Als deze een 
man over de vloer heeft, komt So-mi naar Tae-sik en besteedt daar haar tijd. Op een dag levert Hyo-jeong een pakje bij Tae-sik 
in met de vraag dit voor hem te bewaren. Dit is het begin van een hoop ellende voor Tae-sik.
